import React from 'react';

const ImageList = props => {
  const images = props.images.map(({descrption, id, urls}) => {
    return <img key={id} alt={descrption} src={urls.regular}/>
  });

  return (<div className='image-list'>
    {images}
  </div>);
};

export default ImageList;
